script: |
  super -f text -I q2266.spq | sort > q2266.out

inputs:
  - name: q2266.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN col0 AND + col1 * col1 * col2 - - col2 OR NOT ( - col2 - cor0.col1 * col1 ) <> NULL;
  - name: tab1

outputs:
  - name: q2266.out
    data: |
